            <Product name="RTX 2080" price="59000" url="https://5.imimg.com/data5/SELLER/Default/2022/11/GI/SO/CV/139444584/geforce-rtx-2080-8gb-graphics-car-500x500.jpg"></Product>
            <Product name="RTX 3090" price="110000" url="https://www.zotac.com/download/files/styles/w1024/public/product_gallery/graphics_cards/zt-a30900c-10p-image01.jpg?itok=Trdlnpvm"></Product>
            <Product name="RTX 4090" price="180000" url="https://m.media-amazon.com/images/I/71EP3+gnSxL._AC_UF894,1000_QL80_.jpg"></Product>
        </div>
    )
